-- ==============================
-- STEP 1: CREATE DATABASE
-- ==============================
CREATE DATABASE IF NOT EXISTS RetailSalesDB;
USE RetailSalesDB;

CREATE TABLE IF NOT EXISTS RetailTransactions (
    TransactionID VARCHAR(20) PRIMARY KEY,
    TransactionDate DATE,
    CustomerID VARCHAR(20),
    ProductCategory VARCHAR(50),
    Quantity INT,
    UnitPrice DECIMAL(10,2),
    PaymentMethod VARCHAR(30),
    City VARCHAR(50),
    TotalAmount DECIMAL(12,2)
);

SELECT COUNT(*) AS Total_Rows FROM RetailTransactions;
SELECT * FROM RetailTransactions LIMIT 5;

CREATE OR REPLACE VIEW City_Sales_Last_Quarter AS
SELECT
    City,
    SUM(TotalAmount) AS TotalSales
FROM RetailTransactions
WHERE TransactionDate >= DATE_SUB(
    (SELECT MAX(TransactionDate) FROM RetailTransactions),
    INTERVAL 3 MONTH
)
GROUP BY City;

CREATE OR REPLACE VIEW Top_5_Product_Categories AS
SELECT
    ProductCategory,
    SUM(TotalAmount) AS TotalRevenue
FROM RetailTransactions
GROUP BY ProductCategory
ORDER BY TotalRevenue DESC
LIMIT 5;

CREATE OR REPLACE VIEW Monthly_Sales_Trend AS
SELECT
    DATE_FORMAT(TransactionDate, '%Y-%m') AS Month,
    SUM(TotalAmount) AS MonthlySales
FROM RetailTransactions
GROUP BY Month
ORDER BY Month;

CREATE OR REPLACE VIEW City_Sales_Percentage AS
SELECT
    City,
    ROUND(
        SUM(TotalAmount) * 100.0 /
        (SELECT SUM(TotalAmount) FROM RetailTransactions),
        2
    ) AS SalesPercentage
FROM RetailTransactions
GROUP BY City;

CREATE OR REPLACE VIEW Payment_Method_Sales AS
SELECT
    PaymentMethod,
    SUM(TotalAmount) AS TotalSales
FROM RetailTransactions
GROUP BY PaymentMethod;

CREATE OR REPLACE VIEW Category_Monthly_Trend AS
SELECT
    DATE_FORMAT(TransactionDate, '%Y-%m') AS Month,
    ProductCategory,
    SUM(TotalAmount) AS TotalSales
FROM RetailTransactions
GROUP BY Month, ProductCategory
ORDER BY Month;

CREATE OR REPLACE VIEW Loyal_Customers AS
SELECT
    CustomerID,
    COUNT(TransactionID) AS PurchaseCount,
    SUM(TotalAmount) AS TotalSpent
FROM RetailTransactions
GROUP BY CustomerID
HAVING COUNT(TransactionID) > 10
ORDER BY TotalSpent DESC;

CREATE OR REPLACE VIEW KPI_Metrics AS
SELECT
    SUM(TotalAmount) AS TotalSales,
    COUNT(TransactionID) AS TotalTransactions,
    COUNT(DISTINCT CustomerID) AS UniqueCustomers,
    ROUND(SUM(TotalAmount) / COUNT(TransactionID), 2) AS AverageOrderValue
FROM RetailTransactions;
